import RecommendedForYouSection from './RecommendedForYouSection';
import BecauseYouLikedSection from './BecauseYouLikedSection';

const RecommendationsContainer = () => {
  return (
    <div className="recommendations-container">
      {/* Recommended for You - Collaborative Filtering */}
      <RecommendedForYouSection />
      
      {/* Because You Liked - Content-Based */}
      <BecauseYouLikedSection />
    </div>
  );
};

export default RecommendationsContainer;
